    If there are several items with similar sum of their digits, order them based on their index in original list.
    """
    return sorted(nums, key=lambda x: (sum(int(d) for d in str(abs(x))), nums.index(x)))

def specialFilter(nums):
    def is_odd_and_greater_than_10(n):
        str_n = str(abs(n))
        return n > 10 and int(str_n[0]) % 2 != 0 and int(str_n[-1]) % 2 != 0

    return sum(1 for num in nums if is_odd_and_greater_than_10(num))

def get_max_triples(n):
    a = [i * i - i + 1 for i in range(1, n + 1)]
    count = 0
    for i in range(n):
        for j in range(i + 1, n):
            for k in range(j + 1, n):
                if (a[i] + a[j] + a[k]) % 3 == 0:
                    count += 1
    return count

def bf(planet1, planet2):
